    editableInit: function editableInit(el) {

        var self = this;

        play.registerEditableProp($(el).prop("tagName"), {
            parentable: false,

            editable: true

        });

        $(el).prop("editable", true);

        play.registerChildEditableProp($(el).prop("tagName"), "p-icon", {
            parentable: false,
            selectable: true,
            removeable: true,
            resizeable: false,
            moveable: false,
            picable: false

        });

        if (el.is("p-text")) {
            $(el).prop("showName", "段落");

            play.registerEditableProp($(el).prop("tagName"), {
                parentable: false,
                "resizeable": { y: false },
                editable: true

            });
        } else if (el.is("p-h")) {
            $(el).prop("showName", "标题");

            $(el).prop("resizeable", true);
        } else if (el.is("p-text-wrap")) {
            $(el).prop("showName", "单行文字");

            $(el).prop("resizeable", true);
        } else {

            $(el).prop("showName", "链接");

            $(el).prop("resizeable", true);
        }

        if (!el.prop("fixedable")) {
            $(el).prop("fixedable", true);
        }
        if (!el.prop("removeable")) {
            $(el).prop("removeable", true);
        }

        if (!el.prop("parentable")) {
            $(el).prop("parentable", false);
        }
        if (!el.prop("editable")) {
            $(el).prop("editable", true);
        }
    },

